    "2016-07-16T01:34:01.463673",nt"name": "range-grazing-pastures-polygon",nt"isopen":
    false,nt"url": null,nt"notes": "This polygon feature class depicts the
    boundaries of the livestock grazing pastures located within the Idaho BLM, Idaho,
    USA. A pasture is a sub-unit of a grazing allotment, each allotment is comprised
    of at least one pasture. In some cases, this layer identifies the BLM managed public
    land or other land associated with specific grazing allotments administered by the
    local BLM field office. Boundaries may be fences, arbitrary lines, or natural barriers.
    Agency management of polygons within this feature class is not specific to BLM;
    other agencies are also included.",nt"license_title": null,nt"extras":
